import React from 'react';
import { AppBar, Button, Tab, Tabs, Toolbar, Typography } from '@mui/material'
import MedicalServicesIcon from '@mui/icons-material/MedicalServices';
import ShoppingCartSharpIcon from '@mui/icons-material/ShoppingCartSharp';
// import { Outlet, Link } from "react-router-dom";
import Link from '@mui/material/Link';
const Header = () => {
    return (
        <React.Fragment>
            <AppBar position="sticky" elevation={0}>
                <Toolbar>
                    <MedicalServicesIcon />
                    <Typography sx={{ padding: "10px" }}>Welcome to Med/Pharma</Typography>
                    {/* <Tabs textColor='1px solid white'> */}
                            {/* <Tab label="Home" /> 
                             <Tab label="About" />
                            <Tab label="Contact" /> */}
                            <Link href="/"><Typography sx={{ padding: "10px" , color:"red"}}>Home</Typography></Link>
                            <Link href="/about"><Typography sx={{ padding: "10px" , color:"red"}}>About</Typography></Link>

                            <Link href="/contact"><Typography sx={{ padding: "10px" , color:"red"}}>Contact</Typography></Link>

                        {/* </Tabs> */}


                    <Button variant="contained" sx={{ marginLeft: "37rem" }}>Login</Button>
                    <ShoppingCartSharpIcon sx={{ marginLeft: "auto" }} />
                </Toolbar>
            </AppBar>
        </React.Fragment>

    )
}

export default Header;
